import React from 'react'; 
import ProductsDisplay from './ProductsDisplay.jsx'

const ContentContainer = (props) => {
    return( 
      <ProductsDisplay 
        productUrls={this.props.state.productUrls} 
      /> 
   ); 
}; 

export default ContentContainer;
